Golden Finger Fryums with Potatoes

A traditional Gujarati street food, with enormous variations to the recipe according to taste but serves with same emotions. Truely amazing.

#gujaratifood#food_souvenir
#foodphotography#goodfood
#goodmood#foodie #foodporn
#foodblogger #foodofinsta #foodstagram#foodiesofinstagram
#foodlover #homecooking#homechef
#homedcooked #instafood#gujaratifood
#snacks#gujaratifoodie #gujjufood
#gujjugram#food_souvenir

Ingredients:

Boiled & Diced Potatoes
Garlic Cloves - (15-20)
Chilli Powder
Coriander Powder
Garam Masala/ mixture of ground spices
Turmeric
Cloves
Star Anise
Salt
Water
Oil
Lemon
Golden Finger Fryums

Method:

Take garlic cloves+chilli powder (3teaspoon)+ cloves (2-3pcs)+star Anise (1pc), Add these and crush it in a hand crusher and make into a paste consistency. Avoid using mixer grinder for better taste. Heat a pan, add oil and garlic chilli paste to it.  Cook on low flame and saute it. Add Chilli Powder +Coriander Powder+ Garam Masala/ mixture of ground spices+Turmeric+ Salt and saute for a while. Add some water, boil for while to a thick gravy consistency. Add this gravy to Boiled & Diced potatoes. Serve with lemon & Buttermilk.

Sweet Tamarind (Meethi Chutney):
Soaked Tamarind & Dates (without seeds), coriander seeds+jaggery+pink salt+ pinch of chilli powder- Grind well. Add water and serve as a  dip. ( watery consistency)

